import React from "react";

function Card() {
    return (
        <div class="card">
            <div class="card-body">
                <h5 class="card-title">Some Text</h5>
                <p class="card-text">Test</p>
                <a href="#" class="btn btn-primary">Go somewhere</a>
            </div>
        </div>
    )
}

export default Card;
